import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { Message } from 'src/app/data/message';

@Injectable({
  providedIn: 'root'
})
export class MessageService {

  messagesValues: Message[] = [];
  messages: BehaviorSubject<Message[]> = new BehaviorSubject<Message[]>(this.messagesValues);

  constructor() { }
}
